import React, { useState } from 'react';
import axios from 'axios';
import './EditableTable.css';
import { useNavigate } from 'react-router-dom';
import extractDataFromCSV from './extractDataFromCSV';

const EditableTable = ({ data, columns, options }) => {
  const navigate = useNavigate();
  const [tableData, setTableData] = useState(data);
  const [selectedFile, setSelectedFile] = useState(null);

  const handleCellEdit = (rowIndex, columnIndex, value) => {
    const updatedData = [...tableData];
    updatedData[rowIndex][columnIndex] = value;
    setTableData(updatedData);
  };

  const addRow = () => {
    const newRow = [tableData[tableData.length - 1][0], tableData[tableData.length - 1][1], tableData[tableData.length - 1][2], '', '', '', '', '', '', ''];
    setTableData([...tableData, newRow]);
  };

  const handleSubmit = () => {
    // TODO //////////////////////////////////////////////
    // Call python backend to grade each row in tableData

    // Use navigate to go to the graphs page with data
    navigate('/export-pdf', { state: { tableData: tableData } });
  };

  const handleFileChange = (event) => {
    setSelectedFile(event.target.files[0]);
  };

  const handleFileUpload = () => {
      if (!selectedFile) {
          alert("Please select a file first.");
          return;
      }

      extractDataFromCSV(selectedFile)
          .then(data => {
              setTableData(data);
          })
          .catch(err => {
              console.error("Error processing file:", err);
          });
    };

    const gradePitch = async () => {
      try {
          const params = {
              pitch_type: 'RH_4S_Fastball', // Replace with actual value
              velocity: 5, // Replace with actual value
              ivBreak: 7, // Replace with actual value
              hBreak: 2, // Replace with actual value
              spinRate: 8, // Replace with actual value
              relHeight: 5, // Replace with actual value
              extension: 1, // Replace with actual value
              vAppAngle: 4 // Replace with actual value
          };
  
          const response = await axios.get('http://localhost:5000/api/grade_pitch', { params });
          console.log(response.data); // handle the response as needed
      } catch (error) {
          console.error('Error fetching data: ', error);
      }
  };
  

  return (
    <div>
      <table className="editable-table">
        <thead>
          <tr>
            {columns.map((column, columnIndex) => (
              <th key={columnIndex}>{column}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, rowIndex) => (
            <tr key={rowIndex}>
              {row.map((cell, columnIndex) => (
                <td key={columnIndex}>
                  {columnIndex <= 2 && columnIndex >= 1 ? (
                    <select
                      value={cell}
                      onChange={(e) => handleCellEdit(rowIndex, columnIndex, e.target.value)}

                    >
                      <option value="">Select...</option>
                      {options[columnIndex-1].map((option, index) => (
                        <option key={index} value={option}>
                          {option}
                        </option>
                      ))}
                    </select>
                  ) : columnIndex === 0 ? (
                    <input
                      type="text"
                      value={cell}
                      onChange={(e) => handleCellEdit(rowIndex, columnIndex, e.target.value)}
                      className="name-cell" // Apply the 'name-cell' class
                    />
                  ) : (
                    <input
                      type="text"
                      value={cell}
                      onChange={(e) => handleCellEdit(rowIndex, columnIndex, e.target.value)}
                      className='input-cell'
                    />
                  )}
                </td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>
        <button onClick={addRow}>Add Row</button>
        <button onClick={handleSubmit}>Submit</button> 
      <table>
        <input type="file" accept=".csv" onChange={handleFileChange} />
        <button onClick={handleFileUpload}>Upload CSV</button>
      </table>
    </div>
  );
};

export default EditableTable;
